import { useState } from "react";

export default function Dashboard() {
    const [currentPage, setCurrentPage] = useState("dashboard");


    return (
        <div className="flex flex-col h-screen">
            {/* Top Navbar */}
            <div className="h-16 bg-[#181818] text-white flex items-center justify-between border-b border-[#333]">
                <div className="w-64 text-center">
                    <h1 className="text-3xl font-bold cursor-pointer" onClick={() => { window.location.href = "/" }}>In<span className="text-[#ce93d8]">Site</span></h1>

                </div>
                <div>
                    <button className="px-4 py-2 mr-4">Logout</button>
                </div>
            </div>

            {/* Main Content */}
            <div className="flex flex-1 text-center">
                {/* /* Left Sidebar * */}
                <div className="w-64 bg-[#181818] text-white p-4 border-r border-[#333] cursor-pointer">
                    <ul>
                        {currentPage === "dashboard" ? (
                            <div>
<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fill="currentColor" class="size-6">
  <path d="M11.47 3.841a.75.75 0 0 1 1.06 0l8.69 8.69a.75.75 0 1 0 1.06-1.061l-8.689-8.69a2.25 2.25 0 0 0-3.182 0l-8.69 8.69a.75.75 0 1 0 1.061 1.06l8.69-8.689Z" />
  <path d="m12 5.432 8.159 8.159c.03.03.06.058.091.086v6.198c0 1.035-.84 1.875-1.875 1.875H15a.75.75 0 0 1-.75-.75v-4.5a.75.75 0 0 0-.75-.75h-3a.75.75 0 0 0-.75.75V21a.75.75 0 0 1-.75.75H5.625a1.875 1.875 0 0 1-1.875-1.875v-6.198a2.29 2.29 0 0 0 .091-.086L12 5.432Z" />
</svg>

                                <li className="mb-4 p-3 bg-[#333] transition-colors duration-300 rounded-xl" onClick={() => setCurrentPage("dashboard")}>Dashboard</li>
                            </div>
                        ) : (
                            <div>
<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fill="currentColor" class="size-6">
  <path d="M11.47 3.841a.75.75 0 0 1 1.06 0l8.69 8.69a.75.75 0 1 0 1.06-1.061l-8.689-8.69a2.25 2.25 0 0 0-3.182 0l-8.69 8.69a.75.75 0 1 0 1.061 1.06l8.69-8.689Z" />
  <path d="m12 5.432 8.159 8.159c.03.03.06.058.091.086v6.198c0 1.035-.84 1.875-1.875 1.875H15a.75.75 0 0 1-.75-.75v-4.5a.75.75 0 0 0-.75-.75h-3a.75.75 0 0 0-.75.75V21a.75.75 0 0 1-.75.75H5.625a1.875 1.875 0 0 1-1.875-1.875v-6.198a2.29 2.29 0 0 0 .091-.086L12 5.432Z" />
</svg>

                                <li className="mb-4 p-3 hover:bg-[#333] transition-colors duration-300 rounded-xl" onClick={() => setCurrentPage("dashboard")}>Dashboard</li>
                            </div>
                        )}

                        {currentPage === "feedback" ? (
                            <li className="mb-4 p-3 bg-[#333] transition-colors duration-300 rounded-xl" onClick={() => setCurrentPage("analytics")}>Feedback</li>
                        ) : (
                            <li className="mb-4 p-3 hover:bg-[#333] transition-colors duration-300 rounded-xl" onClick={() => setCurrentPage("analytics")}>Feedback</li>
                        )}

                        {currentPage === "settings" ? (
                            <li className="mb-4 p-3 bg-[#333] transition-colors duration-300 rounded-xl" onClick={() => setCurrentPage("settings")}>Settings</li>
                        ) : (
                            <li className="mb-4 p-3 hover:bg-[#333] transition-colors duration-300 rounded-xl" onClick={() => setCurrentPage("settings")}>Settings</li>
                        )}
                    </ul>
                </div>

                {/* Main Content Area */}
                <div className="flex-1 p-6 text-white">
                    <h2 className="text-2xl font-bold mb-4">Main Content Area</h2>
                    <p>
                        This is the main content area. Add your dashboard components here.
                    </p>
                </div>
            </div>
        </div>
    );
}
